import React from 'react';


const App = () => {

  const inputEvent = (event) => {
       console.log(event.target.value)
  }
  return (
    <>
    <div>
      <h1>Hello Name</h1>
      <input type = "text" placeholder="Enter Your Name" onChange={inputEvent} /><br/>
      <button type="submit">Click Me</button>
    </div>
    </>
  )
}

export default App ;
